import React, { useState, useEffect } from 'react';

function FetchDataa() {

    const [story, setStory] = useState([]);

    const getStory = () => {
        fetch('http://localhost:4000/stories')
        .then(res => res.json())
        // .then(data => {
        //     setStory(data[1].body);
        //     console.log(data);
        // })
        .then(data => {
            let array = data.map(ob => <p key={ob._id}>{ob.body}</p>)
            setStory(array);
        })

    }
  return (
    <div>
        <button onClick={getStory}>Get story</button>
        <div>{story}</div>
    </div>
  )
}

export default FetchDataa;
